import React from "react";
function Service()
{
    return (<>
                <div className="my-5">
                    <h1 className="text-center">Our Services</h1>
                </div>

                <div className="container-fluid mb-5">
                    <div className="row">
                        <div className="col-10 mxauto">

                        </div>
                    </div>
                </div>


            </>)
}

export default Service;
